import React from 'react';

const LoginCerberus = () => {
  let intro = {
    svg: '/logo/Cerberus_logo.svg',
    name: 'cerberus'
  };

  return (
    <div className="login">
      <div className="intro">
          <h2 className="subsubtitle">Hi, welcome to</h2>
          <h2 className="subtitle">THE NEW</h2>
          <h1 className="title">TEST MANAGEMENT</h1>
      </div>
      <div id="login">
        
      </div>
    </div> 
    );
}

export default LoginCerberus;
